import axios from 'axios';
import React, { useState, useEffect } from 'react';

function App() {
  return (
    axios.get('http://127.0.0.1:8000/api/dogWalkers').then((walker)=>{const allWalkers = walker.data;console.log(allWalkers)}),
    <div id="dogWalkers"></div>
  );
}

export default App;
